import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Link} from 'react-router-dom';
import './App.css';
import WeatherAPI from './WeatherAPI';



function App() {

    const [weather, setWeather] = useState([]);

    useEffect(() => {
        // let geo = WeatherAPI.getLatLngFromZipCode(92606)
        // console.log(geo);

        let zipCode = '92606'
        WeatherAPI.getLatLngFromZipCode(zipCode)
            .then(({ latitude, longitude }) => {
                console.log(`Latitude: ${latitude}, Longitude: ${longitude}`);
            })
            .catch((error) => {
                console.error(error);
            });



        const xhr = new XMLHttpRequest();
        xhr.withCredentials = true;

        xhr.addEventListener('readystatechange', function () {
            if (this.readyState === this.DONE) {
                if (this.status === 200) {
                    try {
                        const response = JSON.parse(this.responseText);
                        setWeather([response]);
                    } catch (error) {
                        console.error('Error parsing JSON:', error);
                    }
                } else {
                    console.error('Request failed with status:', this.status);
                }
            }
        });


        xhr.open('GET', 'https://us-weather-by-zip-code.p.rapidapi.com/getweatherzipcode?zip=94111');
        xhr.setRequestHeader('X-RapidAPI-Key', '3dffb96613mshcec6abad3e2f1c4p176c33jsn294e2dc906bb');
        xhr.setRequestHeader('X-RapidAPI-Host', 'us-weather-by-zip-code.p.rapidapi.com');

        xhr.send();

        return () => {
            xhr.removeEventListener('readystatechange', function () {});
        };

    }, []);

    const handleWeather = (e) => {
        e.preventDefault();
        setWeather((data) => [...data, {}]);
    };

  return (
    <div>
        <Router>
            <Routes>
                <Route path="/" element={
                    <Weather
                        weather = {weather}
                        setWeather = {setWeather}
                    />}/>
                <Route path="/favorites" element={<Favorites />}/>
                <Route path="/popular" element={<Popular />}/>
            </Routes>
        </Router>
    </div>
  );
}

function Nav() {
    return (
        <ul id='nav'>
            <li><Link to="/">Weather</Link></li>
            <li><Link to="/favorites">Favorites</Link></li>
            <li><Link to="/popular">Popular</Link></li>
        </ul>
    );
}

function Header() {
    return (
        <div className='App'>
            <h2>Weather App</h2>
            <Nav />
        </div>
    );
}


function Weather(props) {
    const [city, setCity] = useState('');
    const [temperature, setTemperature] = useState('');
    const [weather, setWeather] = useState('');

    const handleFormSubmit = (e) => {
        e.preventDefault();
        const cityWeather = props.weather.find((data) => data.city === city);
        if (cityWeather) {
            setTemperature(cityWeather.TempF);
            setWeather(cityWeather.Weather);
        } else {
            setTemperature('');
            setWeather('');
        }
        setCity('');
    };

    return (
        <div className="app-center">
            <Header />
            <form onSubmit={handleFormSubmit}>
                <input
                    type="text"
                    value={city}
                    onChange={(e) => setCity(e.target.value)}
                    placeholder="Enter Zip code"
                />
                <button type="submit">Get Weather</button>
            </form>
            <p>City: {city}</p>
            <p>Temperature: {temperature}</p>
            <p>Weather: {weather}</p>
        </div>
    )
}


function Favorites() {
    return (
        <div className="app-center">
            <Header />
            <h3>Favorites</h3>


        </div>
    )
}


function Popular() {
    return (
        <div className="app-center">
            <Header />
            <h3>Popular Locations</h3>


        </div>
    )
}


export default App;
